import { Link } from 'react-router-dom';
import React, { useState } from 'react';

function DestItem({ image, name, id }) {
  const [id2, setId] = useState(null);

  const handleClick = (idNumber) => {
    setId(idNumber);
  };
  return (
    <div className="destItem">
      <div 
        style={{ 
          backgroundImage: `url(${image})`,
        }} 
      >
        <Link to={`/destinations/${id}`} className="destText">
          <button onClick={() => handleClick(123)}
            className="destText"
          >
            {name}
          </button>
        </Link>
      </div>
    </div>
  );
}

export default DestItem;
